import SettingsMenu from './SettingsMenu';
import HelpMenu from './HelpMenu';

export default function TopNav() {
  return (
    <div className="flex justify-between items-center bg-[#1A2530] text-white px-4 py-2">
      <div className="text-lg font-semibold">amazon vendor central</div>

      <div className="flex items-center gap-6">
        <HelpMenu />
        <SettingsMenu />
      </div>
    </div>
  );
}
